package class36;

import java.util.Base64;

public class Test {
    static char[] s = new char[26 + 10 + 1];
    static StringBuilder sb = new StringBuilder(12);
    public static void main(String[] args) {
        for (int i = 0; i < 26; i++) {
           s[i] = (char)('a' + i);

        }
        for (int i = 26; i < 26 + 10; i++) {
            s[i] = (char)(i - 26 + '0');
        }
        s[26 + 10] = '_';
        for (char c : s) {
            System.out.println(c);
        }
        for (int i = 0; i < 10; i++) {
            //[0, 35]
            sb.append(s[(int)(Math.random() * 37)]);

        }
        System.out.println(sb.toString());


        System.out.println(new String(Base64.getDecoder().decode("")));

    }
}
